function(){
  // get current form
  var form = {{Form Element}};
  var name = 'no-value';
  if(form) {
    // look to see if the form has a name attribute, then an id, otherwise it will attempt to use the parent element classes
    if(typeof form.name != 'undefined' && form.name.length > 0) {
      name = form.name;

    } else if(typeof form.id != 'undefined' && form.id.length > 0) {
      name = form.id;
    } else {
      var pt = form.parentNode;
      name = pt && pt.className ? pt.className.trim() : name;
    }
  }
  return name;
}

function(){
  var path = {{Page Path}};
  var query = {{URL - Query - WOVG}};
  var queryConfig = {{Const - Query - Accepted - WOVG - Config}};
  var queryList = queryConfig && queryConfig.length > 0 ? queryConfig.split(',') : undefined;
  var queryReplace = '';
  if(/\*/.test(queryConfig)){
    return undefined;
  } else if(query && query.length > 0) {
    queryList.forEach(function(value) {
      if(query.indexOf(value+'=') >= 0){
        queryReplace += queryReplace == '' ? '?' : '&';  
        queryReplace +=  value +'='+query.split(value+'=')[1].split('&')[0];
      }                        
    });
    return path+queryReplace;
  }
  return path;
}

